import React from "react";
import './App.css';
import { connect } from "react-redux";

function App({user}) {
  return (
    <div className="App">
     {user}
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    user: state.user,
  };
};

export default connect(mapStateToProps, null)(App);
